import React from 'react';
import '../styles/contact.css';
import testimg from "../img/testimg.jpg";
import bg16 from "../img/bg16.jpg";
import colab5 from "../img/colab5.jpeg";
import 'antd/dist/antd.css';
import { Input, Button } from 'antd';
import { WhatsAppOutlined,EnvironmentOutlined, PhoneOutlined, MailOutlined } from '@ant-design/icons';

const { TextArea } = Input;


export default function Contact() {
 return (
   <div className="fullpage0" style={{ backgroundImage: `url(${testimg})` }}>        
     <div className="ct">
       <img src={require('../img/colab5.jpeg')} />
       <div className="inputs">
         <div className="adress">
         
           <h1><EnvironmentOutlined />  Av. Central Conjunto 20 lote 01, Sobradinho 2, Distrito Federal, Brasil</h1>
           <h1><PhoneOutlined />  +55 (61) 3485-4568</h1>
           <h1><WhatsAppOutlined />  +55 (61) 9 9999-2351</h1>
           <h1><MailOutlined /> projetos.vs@hotmail.com</h1>
         </div>
         <p>Fale conosco!!</p>
         <div className="med">
       <Input placeholder="Digite seu nome" />
       <Input placeholder="E-mail" />
       <Input placeholder="Telefone" />
       <div className="txta"><TextArea rows={4} /></div>
       <Button type="primary">Enviar</Button>
         </div>
       </div>
     </div> 
     <div className="tx">
     <h1>Entre em contato e junte-se a nós nessa missão.</h1> 
     </div>
     
           
   </div>
 );
}
